import React from 'react'
import styled from 'styled-components'
function Navbar() {
  return (
    <>
    <NavContainer>
        <h2>Inmuebles Ecommerce</h2>
    </NavContainer>
    </>
  )
}

export default Navbar

const NavContainer = styled.nav `
    h2 {
        font-weight: 300px;
        color: white;
    }
    padding: 0.3rem;
    background-color: blue;
    display: flex;
    align-items: center;
    justify-content: space-between;

`
